              CommandObject.Parameters.Add(DataProvider.CreateParameter( 
                  "@CardNumberIsHex", DbType.Boolean, ValidatorObject.Properties.GetByName(CredentialPDSAValidator.ColumnNames.CardNumberIsHex).Value));
              CommandObject.Parameters.Add(DataProvider.CreateParameter( 
                  "@CardBinaryData", DbType.Binary, ValidatorObject.Properties.GetByName(CredentialPDSAValidator.ColumnNames.CardBinaryData).Value));
              CommandObject.Parameters.Add(DataProvider.CreateParameter( 
                  "@UpdateName", DbType.String, ValidatorObject.Properties.GetByName(CredentialPDSAValidator.ColumnNames.UpdateName).Value));
              CommandObject.Parameters.Add(DataProvider.CreateParameter( 
                  "@UpdateDate", DbType.DateTimeOffset, ValidatorObject.Properties.GetByName(CredentialPDSAValidator.ColumnNames.UpdateDate).Value));
              CommandObject.Parameters.Add(DataProvider.CreateParameter( 
                  "@BitCount", DbType.Int16, ValidatorObject.Properties.GetByName(CredentialPDSAValidator.ColumnNames.BitCount).Value));
              CommandObject.Parameters.Add(DataProvider.CreateParameter( 
                  "@ConcurrencyValue", DbType.Int16, ValidatorObject.Properties.GetByName(CredentialPDSAValidator.ColumnNames.ConcurrencyValue).Value));
              
              break;
            case UpdateFilters.UpdateConcurrency:
             CommandObject.Parameters.Clear();
              CommandObject.Parameters.Add(DataProvider.CreateParameter( 
                  "@CredentialUid", DbType.Guid, ValidatorObject.Properties.GetByName(CredentialPDSAValidator.ColumnNames.CredentialUid).Value));
              CommandObject.Parameters.Add(DataProvider.CreateParameter( 
                  "@ConcurrencyValue", DbType.Int16, ValidatorObject.Properties.GetByName(CredentialPDSAValidator.ColumnNames.ConcurrencyValue).Value));
              
              break;
          }
          break;
      }
    }
